import React, {Component} from 'react';

class ConnectServer extends Component {

    constructor() {
        super();
        this.state = {users: []}
    }

    componentDidMount() {
        let users = fetch("api").then(response => response.json()).then(response => this.setState({users: response}))
    }

    render() {
        return (
            <div>
                <ul>
                    {this.state.users.map(element => (
                        <li>{element.firstName} {element.lastName} {element.memo} {element.number} {element.date }</li>
                    ))
                    }
                </ul>
            </div>
        );
    }
}

export default ConnectServer;
